import React from "react";

class Cardall extends React.Component{

    render(){
        return(
            <div className={this.props.color + " d-flex flex-column justify-content-end logo "}>
                <div>
                    <img src="" alt="" />
                </div>
                <div className="bg-info py-4  card">
                    <div className="d-flex justify-content-around">
                    <p>work</p>
                    <p>...</p>
                    </div>  
                    <h3>32h</h3>
                    <p>Last week</p>              
                </div>
            </div>
        )
    }
}

export default Cardall
